import react from "react";
import{View,Text} from 'react-native'

const CustomInput=()=>{
    return(
        <View>
            <Text style={[styles.text,{width:'78%',lineHeight: Platform.OS === 'ios' ? 20 : 40,height:Platform.OS === 'ios' ? 25 : 42
       ,borderBottomWidth:2,borderBottomColor:'lightsteelblue'}]}>Custom Input</Text>
        </View>
    )
}
export default CustomInput
